import React from "react";
import { BrowserRouter } from "react-router-dom";
import { AuthProvider } from "./contexts/uthContext";
import AppRouter from "./components/routing/AppRouter";
import Header from "./components/layouts/Header";
import "./App.css";
function App() {
  return (
    <BrowserRouter>
      <AuthProvider>
        <div className="App">
          <Header />
          <main>
            <AppRouter />
          </main>
        </div>
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
